import React from 'react';

export default class App extends React.Component {
  constructor(props) {
    super();
    this.state = {
      data: {},
      isLoading: false
    };
  }
  async componentDidMount() {
this.setState({isLoading:true})
const response = await fetch('http://swapi.co/api/starships/')
const json = await response.json()
this.setState({
    isLoading:false,
    data:json.results
})
console.log(this.state.data)
  }
  render() {
      if(this.state.isLoading) {
          return (
              <h1> Loading Data...</h1>
          )
      }
    return (
      <div>
        <h1> Hello World</h1>
      </div>
    );
  }
}
